import "./App.css";
import { useState, useEffect, useContext, createContext } from "react";

// quick helper function to easily convert to title case
function titleCase(str) {
    return str.toLowerCase().replace("-", " ").split(' ').map(w => w[0].toUpperCase() +
           w.substring(1).toLowerCase()).join(' ');
}

// contexts
const PlaneToMoveContext = createContext({
    planeToMove: null,
    setPlaneToMove: () => {}
});

const RefreshTogglerContext = createContext({
    refreshToggler: false,
    setRefreshToggler: () => {}
});

const MovePlaneContext = createContext(() => {});

function RampBox() {
    return (
        <div id="ramp" className="box">
            <div className="box title-box" style={{"fontSize": 1.5+"em"}}>
                Ramp
            </div>
            <table className="table-list" border="1" frame="void" rules="rows">
                <tbody>
                    <RampBoxItem name="ramp-a" />
                    <RampBoxItem name="ramp-b" />
                    <RampBoxItem name="ramp-c" />
                    <RampBoxItem name="ramp-d" />
                    <RampBoxItem name="ramp-e" />
                    <RampBoxItem name="ramp-f" />
                    <RampBoxItem name="ramp-g" />
                    <RampBoxItem name="ramp-h" />
                    <RampBoxItem name="ramp-i" />
                    <RampBoxItem name="ramp-j" />
                    <RampBoxItem name="ramp-k" />
                    <RampBoxItem name="ramp-l" />
                    <RampBoxItem name="ramp-m" />
                    <RampBoxItem name="ramp-n" />
                    <RampBoxItem name="ramp-o" />
                    <RampBoxItem name="ramp-p" />
                    <RampBoxItem name="ramp-q" />
                    <RampBoxItem name="ramp-r" />
                </tbody>
            </table>
        </div>
    );
}

function RampBoxItem({ name }) {

    const { planeToMove, setPlaneToMove } = useContext(PlaneToMoveContext);
    const { refreshToggler, setRefreshToggler } = useContext(RefreshTogglerContext);
    const movePlane = useContext(MovePlaneContext);

    const [spotData, setSpotData] = useState(null);
    useEffect(() => {
        async function getSpotData() {
            const response = await fetch("http://localhost:8080/getSpot?spot=" + name);
            return response.json();
        }
        getSpotData()
            .then(spotData => setSpotData(spotData))
            .catch(e => console.log(e));
    }, [name, refreshToggler]);

    if (spotData) {
        let plane;
        if (spotData.plane) {
            plane = (
                <Plane plane={spotData.plane} />
            );
        }
        let glow = (planeToMove && !spotData.plane ? "glow" : "");
        let upperChar = name.replace("ramp-", "").toUpperCase();
        return (
            <tr id={name} className={glow} onClick={() => movePlane(name, planeToMove)}>
                <td>{upperChar}</td>
                <td>{plane}</td>
            </tr>
        );
    }
}

function DirectionBox() {
    return (
        <div id="direction" className="box">
            <table className="center-table" border="1" frame="void">
                <tbody>
                    <tr>
                        <DirectionBoxItem name="xc-1" />
                        <td>
                            <table className="center-table" border="1" frame="void">
                                <tbody>
                                    <tr>
                                        <DirectionBoxItem name="kmcx" />
                                    </tr>
                                    <tr>
                                        <DirectionBoxItem name="northwest" />
                                        <DirectionBoxItem name="northeast" />
                                    </tr>
                                </tbody>
                            </table>
                        </td>
                        <DirectionBoxItem name="xc-2" />
                    </tr>
                    <tr>
                        <DirectionBoxItem name="xc-3" />
                        <td>
                            <table className="center-table" border="1" frame="void">
                                <tbody>
                                    <tr>
                                        <DirectionBoxItem name="southwest" />
                                        <DirectionBoxItem name="southeast" />
                                    </tr>
                                    <tr>
                                        <DirectionBoxItem name="kcfj" />
                                        <DirectionBoxItem name="kfkr" />
                                    </tr>
                                </tbody>
                            </table>
                        </td>
                        <DirectionBoxItem name="xc-4" />
                    </tr>
                </tbody>
            </table>
        </div>
    );
}

function DirectionBoxItem({ name }) {
    let planes = [];
    for (let i = 0; i < data.spots[name].plane.length; i++) {
        planes.push(
            <Plane plane={data.spots[name].plane[i]} moveMode={moveMode}
                setMoveMode={setMoveMode} />
        );
    }
    let glow = (moveMode ? "glow" : "");
    let classNameVal = "many";
    let colSpanVal = 1;
    let displayName;
    let widthVal;
    let heightVal;
    if (name.length === 4) {
        displayName = name.toUpperCase();
    } else {
        displayName = titleCase(name);
    }
    if (name.includes("xc")) {
        displayName = "XC";
        classNameVal += " vert";
        widthVal = "75px";
        heightVal = "148px";
    } else {
        heightVal = "70px";
    }
    if (name === "kmcx") {
        colSpanVal = 2;
    }
    return (
        <td id={name} className={glow}
                onClick={() => moveHere(name, data, updateData, moveMode, setMoveMode)}
                width={widthVal} height={heightVal} colSpan={colSpanVal}>
            {displayName}
            <div className={classNameVal}>{planes}</div>
        </td>
    );
}

function HangarsBox() {
    return (
        <div id="hangars" className="box">
            <table className="center-table" border="1" frame="void">
                <tbody>
                    <tr>
                        <td colSpan="3" className="hangar-header">Hangar 5</td>
                        <td colSpan="3" className="hangar-header">Hangar 6W</td>
                        <td colSpan="3" className="hangar-header">Hangar 6</td>
                    </tr>
                    <tr>
                        <HangarsBoxItem name="h5-1" spotType="full" />
                        <HangarsBoxItem name="h5-2" spotType="full" />
                        <HangarsBoxItem name="h5-3" spotType="full" />
                        <HangarsBoxItem name="h6w-1" spotType="full" />
                        <td>
                            <table className="center-table" border="1" frame="void">
                                <tbody>
                                    <tr>
                                        <HangarsBoxItem name="h6w-7" spotType="half" />
                                    </tr>
                                    <tr>
                                        <HangarsBoxItem name="h6w-8" spotType="half" />
                                    </tr>
                                </tbody>
                            </table>
                        </td>
